import React from 'react';
import { FiltersContainer, InputContainer } from './FiltersStyle';

export default function Filters(props) {
  const {
    minFilter,
    setMinFilter,

  } = props;
  return (
    <FiltersContainer>
        <InputContainer>
          Preço Mínimo:
          <input
            type="number"
            value={props.minFilter}
            onChange={props.onChangeMinFilter}
          />
        </InputContainer>
        <InputContainer>
          Preço Máximo:
          <input
            type="number"
            value={props.maxFilter}
            onChange={props.onChangeMaxFilter}
          />
        </InputContainer>
        <InputContainer>
          Nome do Produto:
          <input
            type="text"
            value={props.nameFilter}
            onChange={props.onChangeNameFilter}
          />
        </InputContainer>
    </FiltersContainer>
  );
}
